import styled from "styled-components"

export const Title = styled.h1`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
`;

export const Container = styled.div`
    background: yellow;
`;

export const TitleLeft = styled.h2`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: left;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;
export const Title1 = styled.h1`
    position: static;
    width: 34px;
    height: 24px;
    left: 140.5px;
    top: 18px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 24px;
    color: #FFFFFF;
    flex: none;
    order: 0;
    flex-grow: 0;
    margin: 0px 10px;
`;
export const Button1 = styled.button`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: flex-start;
    padding: 18px 129px;
    position: relative;
    width: 315px;
    height: 60px;
    left: 31px;
    top: 712px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border-radius: 99px;
`;
